import React from "react";
import logo from '../assests/Images/logo.png';

function Home() {
    return (
        <div className="container mx-auto p-4">
            <h1 className="text-3xl font-bold underline mb-4 text-blue-600">Home Page</h1>
            <p className="text-lg text-gray-700 bg-yellow-100 p-2 rounded-md shadow-md">
                Welcome to our website! This paragraph uses Tailwind classes.
            </p>
            <button className="mt-4 bg-green-500 hover:bg-green-600 text-white font-semibold py-2 px-4 rounded-lg transition duration-300">
                Click me!
            </button>
        </div>
    )
}

export default Home;
